import React from 'react';
import MakePost from "./MakePost.js";
import Title from "./Title.js";
import Signin from "./Signin.js";
import { Link } from 'react-router-dom';

function Post(props) {
    const { username, entry } = props;
    return (
        <div>
            <h2>{username}</h2>
            <p>{entry}</p>
        </div>
    )
}

function Homepage(props) {
    const {signInPopUp, signOutCool, currentUser, addPostToDB, items} = props;
return(

<div style={{"position":"relative", "marginLeft":"10%"}}>
    <div className="App">
      <Title/>
      <header className="App-header" style={{backgroundColor:"#89CFF0"}}>
        <img id="oskipic" src="https://news.berkeley.edu/wp-content/uploads/2016/09/Oskicupcake500-1.jpg" alt="oski-img2"/>
      </header>

    </div>
    <div className="posts">
        {
            items.map(item => <Post username={item.username} entry={item.entry} />)
        }
    </div>
</div>

);
}



export default Homepage;
